const Search = () => {
    return (
        <Flex w='40%' justify='center' align='center' pt='30px'>
            <FormControl>
                {/* <Flex> */}
                <Box>
                    <YearInput />

                </Box>
                <Box></Box>
                    <Cour />
                {/* </Flex> */}
            </FormControl>
        </Flex>
    )
}

export default Search
